import React from 'react';
import './styles.css'; // Globale CSS-Datei importieren

const Home = () => {
    const content = {
        title: "Willkommen bei DentaView",
        description: "Entdecken Sie die Welt der Zahnanatomie mit interaktiven Modellen.",
        quicklinks: [
            { text: "Impressum", href: "/impressum" },
            { text: "Tipps zur Zahnpflege", href: "/Beitrag2" },
            { text: "Zahnanatomie", href: "/Beitrag1" },
        ],
    };

    return (
        <main>
            <section className="main-content">
                <h2>{content.title}</h2>
                <p>{content.description}</p>
                <div className="quicklinks">
                    <h3>Schnellzugriff</h3>
                    <div className="quicklinks-buttons">
                        {content.quicklinks.map((link, index) => (
                            <a key={index} href={link.href} className="quicklink-box">
                                {link.text}
                            </a>
                        ))}
                    </div>
                </div>
            </section>
        </main>
    );
};

export default Home;
